import React, { useState, useEffect } from 'react';
import Papa from 'papaparse';
import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from 'recharts';

function PopulationGrowthChart() {
  const [data, setData] = useState([]);

  useEffect(() => {
    // Example CSV file path - adjust according to your project structure
    const csvFile = '/path-to-your/city_data.csv';
    fetch(csvFile)
      .then((response) => response.text())
      .then((csvText) =>
        Papa.parse(csvText, { header: true, skipEmptyLines: true })
      )
      .then((parsedData) => setData(parsedData.data))
      .catch((error) => console.error('Error parsing CSV:', error));
  }, []);

  // Example of simple bar chart visualization
  return (
    <ResponsiveContainer width="100%" height={400}>
      <BarChart
        data={data}
        margin={{ top: 20, right: 30, left: 20, bottom: 5 }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />{' '}
        {/* Adjust 'name' to the relevant dataKey in your CSV */}
        <YAxis />
        <Tooltip />
        <Legend />
        <Bar dataKey="value" fill="#8884d8" />{' '}
        {/* Adjust 'value' to the relevant dataKey in your CSV */}
      </BarChart>
    </ResponsiveContainer>
  );
}

export default PopulationGrowthChart;
